import { motion } from 'framer-motion';
import { Activity, Calendar, ClipboardEdit, GraduationCap } from 'lucide-react';
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { getStudentDashboard } from '../../services/studentApi';
import Progress from '../../components/UI/';
import { Card, CardContent, CardHeader, CardTitle } from '../../components/UI/Card';

export default function StudentDashboard() {
    const [dashboardData, setDashboardData] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchDashboardData = async () => {
            try {
                const data = await getStudentDashboard();
                setDashboardData(data);
            } catch (error) {
                console.error('Error fetching dashboard data:', error);
            } finally {
                setLoading(false);
            }
        };

        fetchDashboardData();
    }, []);

    const container = {
        hidden: { opacity: 0 },
        show: {
            opacity: 1,
            transition: {
                staggerChildren: 0.1,
            },
        },
    };

    const item = {
        hidden: { opacity: 0, y: 20 },
        show: { opacity: 1, y: 0 },
    };

    if (loading) {
        return <div>Loading...</div>;
    }

    return (
        <div className="flex min-h-screen w-full flex-col bg-gradient-to-br from-gray-100 to-gray-200">
            <header className="sticky top-0 z-50 w-full border-b bg-white bg-opacity-90 backdrop-blur">
                <div className="container mx-auto flex h-14 items-center">
                    <div className="mr-4 hidden md:flex">
                        <Link to="/" className="mr-6 flex items-center space-x-2">
                            <GraduationCap className="h-6 w-6" />
                            <span className="hidden font-bold sm:inline-block">IMS</span>
                        </Link>
                        <nav className="flex items-center space-x-6 text-sm font-medium">
                            <Link to="/dashboard" className="text-blue-600">
                                Dashboard
                            </Link>
                            <Link to="/reports" className="text-gray-600 hover:text-gray-900">
                                Reports
                            </Link>
                            <Link to="/evaluations" className="text-gray-600 hover:text-gray-900">
                                Evaluations
                            </Link>
                        </nav>
                    </div>
                </div>
            </header>
            <main className="flex-1">
                <motion.div
                    className="container mx-auto py-6 md:py-8"
                    initial="hidden"
                    animate="show"
                    variants={container}
                >
                    <motion.div variants={item} className="mb-8">
                        <h1 className="text-3xl font-bold tracking-tight">
                            Welcome back, {dashboardData.studentName}
                        </h1>
                        <p className="text-gray-600">
                            Here's an overview of your internship progress
                        </p>
                    </motion.div>
                    <div className="grid gap-4 md:grid-cols-3">
                        <motion.div variants={item}>
                            <Card>
                                <CardHeader className="flex flex-row items-center justify-between space-y-0 pb-2">
                                    <CardTitle className="text-sm font-medium">
                                        Reports Submitted
                                    </CardTitle>
                                    <ClipboardEdit className="h-4 w-4 text-gray-500" />
                                </CardHeader>
                                <CardContent>
                                    <div className="text-2xl font-bold">{dashboardData.reportsSubmitted}</div>
                                </CardContent>
                            </Card>
                        </motion.div>
                        <motion.div variants={item}>
                            <Card>
                                <CardHeader className="flex flex-row items-center justify-between space-y-0 pb-2">
                                    <CardTitle className="text-sm font-medium">
                                        Days Remaining
                                    </CardTitle>
                                    <Calendar className="h-4 w-4 text-gray-500" />
                                </CardHeader>
                                <CardContent>
                                    <div className="text-2xl font-bold">{dashboardData.daysRemaining}</div>
                                </CardContent>
                            </Card>
                        </motion.div>
                        <motion.div variants={item}>
                            <Card>
                                <CardHeader className="flex flex-row items-center justify-between space-y-0 pb-2">
                                    <CardTitle className="text-sm font-medium">
                                        Overall Progress
                                    </CardTitle>
                                    <Activity className="h-4 w-4 text-gray-500" />
                                </CardHeader>
                                <CardContent>
                                    <div className="text-2xl font-bold">{dashboardData.overallProgress}%</div>
                                    <Progress value={dashboardData.overallProgress} className="mt-2" />
                                </CardContent>
                            </Card>
                        </motion.div>
                    </div>
                    {/* Add more dashboard content here */}
                </motion.div>
            </main>
        </div>
    );
}
